class AddEditArticleScreen extends StatefulWidget {
  static const String routeName = "/AddEditArticleScreen";
  final AddEditArticleScreenNavigationArgument arguments;

  const AddEditArticleScreen({super.key, required this.arguments});

  @override
  State<AddEditArticleScreen> createState() => _AddEditArticleScreenState();
}

class _AddEditArticleScreenState extends State<AddEditArticleScreen> with MySafeState {
  String _selectedOption = 'Large Language Model (LLM)';
  List<String> radioStringList = <String>[
    ArticleDataSourceTypes.llm,
    ArticleDataSourceTypes.internetSearch,
    ArticleDataSourceTypes.website,
    ArticleDataSourceTypes.contentLibrary,
    ArticleDataSourceTypes.skip,
  ];

  Future<void> onNextTap() async {
    ArticleContentModel articleContentModel = widget.arguments.coCreateContentAuthoringModel.articleContentModel ??= ArticleContentModel();
    articleContentModel.selectedArticleSourceType = _selectedOption;

    dynamic value = await Navigator.pushNamed(
      context,
      ArticleEditorScreen.routeName,
      arguments: ArticleEditorScreenNavigationArgument(
        coCreateContentAuthoringModel: widget.arguments.coCreateContentAuthoringModel,
      ),
    );
    if (value == true) {
      Navigator.pop(context, true);
      return;
    }

    /*NavigationController.navigateToArticleEditorScreen(
      navigationOperationParameters: NavigationOperationParameters(
        context: context,
        navigationType: NavigationType.pushNamed,
      ),
      argument: ArticleEditorScreenNavigationArgument(
        model: widget.arguments.model,
        selectedSourceType: _selectedOption,
      ),
    );*/
  }

  @override
  void initState() {
    super.initState();

    _selectedOption = widget.arguments.coCreateContentAuthoringModel.articleContentModel?.selectedArticleSourceType ?? "";
    if (!radioStringList.contains(_selectedOption)) _selectedOption = radioStringList.firstOrNull ?? "";
  }

  @override
  Widget build(BuildContext context) {
    super.pageBuild();
    return GestureDetector(
      onTap: () => FocusScope.of(context).requestFocus(FocusNode()),
      child: Scaffold(
        appBar: AppConfigurations().commonAppBar(
          title: "Generate Article",
        ),
        body: AppUIComponents.getBackGroundBordersRounded(
          context: context,
          child: getMainBody(),
        ),
      ),
    );
  }

  Widget getMainBody() {
    return Padding(
      padding: const EdgeInsets.all(20.0),
      child: Column(
        crossAxisAlignment: CrossAxisAlignment.start,
        children: [
          Expanded(
            child: SingleChildScrollView(
              child: Column(
                crossAxisAlignment: CrossAxisAlignment.start,
                children: [
                  const Text(
                    "Select Data Source",
                    style: TextStyle(
                      fontSize: 16,
                      fontWeight: FontWeight.w800,
                    ),
                  ),
                  const SizedBox(height: 10),
                  Container(
                    decoration: BoxDecoration(border: Border.all(color: Styles.borderColor), borderRadius: BorderRadius.circular(5)),
                    child: Column(
                      children: radioStringList
                          .map(
                            (e) => getRadioButtonCommonWidget(
                              groupValue: _selectedOption,
                              value: e,
                              onChanged: (String? value) {
                                setState(() {
                                  _selectedOption = value!;
                                });
                              },
                            ),
                          )
                          .toList(),
                    ),
                  ),
                ],
              ),
            ),
          ),
          const SizedBox(height: 10),
          CommonButton(
            onPressed: () {
              onNextTap();
            },
            text: "Next",
            minWidth: double.infinity,
            fontColor: themeData.colorScheme.onPrimary,
          ),
        ],
      ),
    );
  }

  Widget getRadioButtonCommonWidget({required String value, String? groupValue, required ValueChanged<String?> onChanged}) {
    return RadioListTile(
      title: Text(
        value,
        style: const TextStyle(
          fontSize: 14,
        ),
      ),
      value: value,
      groupValue: _selectedOption,
      onChanged: onChanged,
    );
  }
}

