-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="66" height="78" src="data:image/jpg;base64,"/></td></tr></table></span></p><h2 style="padding-top: 3pt;padding-left: 49pt;text-indent: 0pt;text-align: center;">International Journal of</h2><p class="s17" style="padding-top: 2pt;padding-left: 96pt;text-indent: 0pt;line-height: 114%;text-align: center;">INTELLIGENT SYSTEMS AND APPLICATIONS IN ENGINEERING</p><p class="s18" style="padding-left: 69pt;text-indent: 0pt;text-align: left;"><a href="http://www.ijisae.org/" class="s19" target="_blank">ISSN:2147-6799                </a>www.ijisae.org                  Original Research Paper</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 6pt;text-indent: 0pt;line-height: 1pt;text-align: left;"/><h1 style="padding-top: 5pt;text-indent: 0pt;text-align: center;">Biotechnology and Genetic Engineering using AI: A Review</h1><p style="text-indent: 0pt;text-align: left;"><br/></p><h3 style="padding-left: 10pt;text-indent: 0pt;line-height: 114%;text-align: center;">Mrs. K. Sreelakshmi<span class="s20">1</span>, Dr. Prabhat Kumar Vishwakarma<span class="s20">2</span>, Dr. S. Govind Rao<span class="s20">3</span>, Dr. Albia Maqbool<span class="s20">4</span>, Debashisa Samal<span class="s20">5</span>, Dr. Rashmi Saini<span class="s20">6</span>, Garima Thakur<span class="s20">7</span></h3><h4 style="padding-top: 6pt;padding-left: 8pt;text-indent: 0pt;text-align: justify;">Submitted<span class="p">: 03/11/2023   </span>Revised<span class="p">: 25/12/2023   </span>Accepted<span class="p">: 02/01/2024</span></h4><p class="s21" style="padding-top: 7pt;padding-left: 8pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Abstract<span class="s22">: In this paper deep exploration into the intersection of Artificial Intelligence (AI), Biotechnology, and Genetic Engineering, three pioneering frontiers of modern science are presented. AI has been applied in Biotechnology and Genetic Engineering, accelerating research, improving precision, and expanding possibilities. The synergy of these interdisciplinary fields has resulted in emergent domains like Synthetic Biology and Systems Biology. The application of AI techniques, such as Machine Learning and Deep Learning, in tasks like biomarker discovery, drug discovery, gene editing, and genomics research are thoroughly discussed in this paper. Despite AI&#39;s potential, the paper also delves into the challenges that arise, including technical issues like overfitting, model interpretability, and the need for robust evaluation methodologies, as well as ethical and societal considerations. The critical role of mathematical and computational models in understanding and predicting complex biological systems is examined, spanning traditional models to state-of-the-art AI models. Detailed case studies provide practical examples of AI application in gene editing, drug discovery, metabolic engineering, synthetic biology, and personalized medicine. This paper shows that a reflection on the transformative potential of integrating AI, Biotechnology, and Genetic Engineering, underscoring the future research required in this rapidly evolving field and the potential benefits to society at large.</span></p><p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s23" style="padding-left: 8pt;text-indent: 0pt;text-align: justify;">Keywords: <span class="s24">Artificial Intelligence, Biotechnology, Machine Learning, Genetic Engineering, Deep Learning, Neural Networks.</span></p><ol id="l1"><li data-list-text="1."><h3 style="padding-top: 7pt;padding-left: 29pt;text-indent: -21pt;text-align: left;">Introduction</h3><p style="padding-top: 7pt;padding-bottom: 1pt;padding-left: 8pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The  rapid  growth  of  biotechnology  (BT),  genetic engineering (GE), and artificial intelligence (AI) have been key in solving many complex problems faced by our society. The intersection of these three dynamic fields opens  up  new frontiers  for  innovation,  promising transformative  solutions  in  healthcare,  agriculture, environmental conservation, and more [1]. The seeds for this convergence were sown over the past few decades. The areas of BT and GE have had notable advancements since their origins in the early and mid-20th century, respectively [2]. During a same period, the topic of AI emerged as an area of academic inquiry aimed at</p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 1pt;text-align: left;"/><p class="s25" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">1<span class="s26">Associate Professor, ECE Department, Ramireddy Subbarami Reddy Engineering College, Kadanuthala, Kavali, Nellore(Dt.), Andhra Pradesh, India-524142</span></p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 9pt;text-align: justify;"><a href="mailto:sreelu.chandra2006@gmail.com" class="a" target="_blank">Email: </a><a href="mailto:sreelu.chandra2006@gmail.com" target="_blank">sreelu.chandra2006@gmail.com</a></p><p class="s25" style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">2<span class="s26">Professor (CSE) and HOD(AI -DS), IIMT College of Engineering, Greater Noida,</span></p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 9pt;text-align: justify;"><a href="mailto:prof.dr.prabhat@gmail.com" class="a" target="_blank">Email: </a><a href="mailto:prof.dr.prabhat@gmail.com" target="_blank">prof.dr.prabhat@gmail.com</a></p><p class="s25" style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">3<span class="s26">Professor in CSE, Gokaraju Rangaraju Institute of Engineering and Technology(GRIET), Bachupally, Hyderabad-500090</span></p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 9pt;text-align: justify;"><a href="mailto:govind.griet@gmail.com" class="a" target="_blank">Email: </a><a href="mailto:govind.griet@gmail.com" target="_blank">govind.griet@gmail.com</a></p><p class="s25" style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">4<span class="s26">Designation: Lecturer, Department of Computer Sciences Faculty of Computing and Information Technology, Northern Border University, Rafha, Kingdom of Saudi Arabia</span></p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 9pt;text-align: justify;"><a href="mailto:albia.alam@nbu.edu.sa" class="a" target="_blank">Email: </a><a href="mailto:albia.alam@nbu.edu.sa" target="_blank">albia.alam@nbu.edu.sa</a></p><p class="s25" style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">5<span class="s26">assistant professor, Dept. of ECE, ITER, SOA Deemed to be University, Bhubaneswar.</span></p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 9pt;text-align: justify;"><a href="mailto:debashisasamal@soa.ac.in" class="a" target="_blank">Email: </a><a href="mailto:debashisasamal@soa.ac.in" target="_blank">debashisasamal@soa.ac.in</a></p><p class="s25" style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">6<span class="s26">Department of Computer Science and Engineering, G. B. Pant Institute of Engineering and Technology, Pauri Garhwal, Uttarakhand, India.</span></p><p style="padding-left: 5pt;text-indent: 0pt;line-height: 9pt;text-align: justify;"><a href="mailto:2rashmisaini@gmail.com" class="a" target="_blank">Email: </a><a href="mailto:2rashmisaini@gmail.com" target="_blank">2rashmisaini@gmail.com</a></p><p class="s25" style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;text-align: justify;">7<span class="s26">Chandigarh University, Punjab, India,</span></p><p style="padding-top: 7pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">developing robots that had the ability to replicate human intellect [3]. These disciplines have undergone separate evolutionary processes, resulting in notable advancements and substantial milestones. Over the course of the last 10 years, there has been an increasing convergence between these two entities, effectively using their mutual strengths to amplify their respective capabilities [4]. The integration of AI within the fields of biotechnology and genetic engineering holds significant promise. The processing power and pattern recognition capabilities of AI allow researchers to efficiently analyse and comprehend large quantities of biological data with remarkable speed and precision [5]. In contrast, the fields of biotechnology and genetic engineering provide a wide range of intricate challenges that may be addressed by AI, hence creating an advantageous  environment for  the  development of increasingly advanced AI models [6].</p><p style="padding-top: 6pt;padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The  primary  aim  of  this  work  is  to  conduct  a comprehensive  analysis  of  the  current  state  of convergence between AI, BT, and GE. This encompasses an examination of the technology and methodologies used, the challenges faced, and the potential future directions. The present review employs a methodical methodology, whereby a careful selection and analysis of scholarly articles, research papers, and case studies published during the last ten years in the respective domains is undertaken. The study has considerable importance due to its ability to provide academics, policymakers, and industry practitioners a complete comprehension of the interplay between AI, BT, and GE.</p><p style="padding-top: 1pt;padding-left: 5pt;text-indent: 0pt;text-align: left;"><a href="mailto:garimathakur1994@gmail.com" class="s28" target="_blank">Email: &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </a><span class="s27">garimathakur1994@gmail.com &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p style="padding-top: 3pt;padding-left: 16pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The comprehension of this concept is crucial in order to effectively use the capabilities of various disciplines, direct forthcoming investigations and policy choices, and provide insights for industrial implementation [7].</p><p style="padding-top: 5pt;padding-left: 16pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The structure of the paper is as follows: Section 2 provides an overview of the contextual framework and AI Techniques in Biotechnology shown in Section 3. Challenges and limitations explained in Section 4 and mathematical &amp; computational models in Section 5, which is followed by conclusion.</p></li><li data-list-text="2."><h3 style="padding-top: 6pt;padding-left: 38pt;text-indent: -21pt;text-align: justify;">Background</h3><p style="padding-top: 7pt;padding-left: 16pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Understanding the merger of AI, biotechnology, and genetic engineering necessitates a clear comprehension of each individual concept.</p><ul id="l2"><li data-list-text="●"><h4 style="padding-top: 6pt;padding-left: 38pt;text-indent: -18pt;line-height: 114%;text-align: justify;">BT <span class="p">involves the use of biological processes, creatures, or systems for the purpose of producing goods with the aim of enhancing the overall well- being of the human population [1]. The origins of traditional biotechnology may be traced back to ancient civilizations, when early practises such as the production of beer and the fermentation of food were prevalent. The field of modern BT has seen significant growth, including a diverse array of applications. These applications span from the development of medical medicines and diagnostic instruments to the implementation of effective methods for the remediation of hazardous waste [2] [8-12].</span></h4></li><li data-list-text="●"><h4 style="padding-top: 5pt;padding-left: 38pt;text-indent: -18pt;line-height: 112%;text-align: justify;">GE <span class="p">refers to the deliberate alteration of an organism&#39;s  genetic  material  via  the  use  of biotechnological  techniques.  The  ability  to manipulate DNA via molecular cloning and gene</span></h4><p style="padding-top: 3pt;padding-left: 34pt;text-indent: 0pt;line-height: 114%;text-align: justify;">sequencing methods has only been achievable since the discovery of the DNA structure in 1953 [3]. The field of genetic engineering enables scientists to manipulate the genetic composition of an organism with precision, hence facilitating the addition, removal, or modification of genes in order to attain certain  traits  [13-20].  The  field  of  genetic engineering has significant implications in the domains of health, agriculture, and environmental research [4].</p></li><li data-list-text="●"><h4 style="padding-top: 5pt;padding-left: 34pt;text-indent: -18pt;line-height: 113%;text-align: justify;">AI <span class="p">encompasses a wide range of applications and disciplines. At a broad level, the concept entails the development of computers that possess the ability to imitate human intellect, acquire knowledge from experiences,  comprehend  intricate  information, participate in many types of social engagement, and perhaps demonstrate creative capabilities [5]. AI comprises a range of techniques and subfields, such as ML, DL, and NNs, each with their own methodologies and applications [6].</span></h4></li><li data-list-text="●"><h4 style="padding-top: 6pt;padding-left: 34pt;text-indent: -18pt;line-height: 114%;text-align: justify;">Intersection of AI, BT, and GE <span class="p">is a novel and pioneering area of scholarly investigation. The use of AI and its computing capabilities, together with its aptitude for pattern recognition in extensive datasets, has expedited several procedures in the fields of biotechnology and genetic engineering. This has resulted in the generation of rapid, efficient, and accurate outcomes [7]. The integration of these disciplines has created novel opportunities in the fields  of  pharmaceutical  research,  genetic manipulation, individualised healthcare, and several other areas [8]. Table 1 presents the foundational principles.</span></h4><p style="padding-top: 7pt;text-indent: 0pt;text-align: left;"><br/></p><h4 style="padding-left: 9pt;text-indent: 0pt;text-align: center;">Table 1<span class="p">. Definitions and Fundamental Concepts</span></h4><p style="text-indent: 0pt;text-align: left;"><br/></p><table style="border-collapse:collapse;margin-left:39.474pt" cellspacing="0"><tr style="height:20pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="text-indent: 0pt;text-align: center;">Term</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="text-indent: 0pt;text-align: center;">Definition</p></td></tr><tr style="height:20pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="text-indent: 0pt;text-align: center;">AI</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">The capacity of a machine to replicate intelligent human behaviour.</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="text-indent: 0pt;text-align: center;">ML</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">ML is a branch of AI that enables systems to acquire knowledge and improve their performance via experience, without the need for explicit programming.</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="text-indent: 0pt;text-align: center;">BT</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 4pt;text-indent: 0pt;line-height: 114%;text-align: left;">The use of biological systems and organisms for the purpose of product development or production.</p></td></tr><tr style="height:20pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="text-indent: 0pt;text-align: center;">GE</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">The process of directly manipulating an organism&#39;s genes via the use of BT.</p></td></tr><tr style="height:46pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="text-indent: 0pt;text-align: center;">DL</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 4pt;text-indent: 0pt;line-height: 114%;text-align: justify;">One sort of ML is the training of a computer system to execute activities that resemble human capabilities, such as voice recognition, picture identification, and predictive analysis.</p></td></tr><tr style="height:46pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="text-indent: 0pt;text-align: center;">NN</p></td><td style="width:345pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 5pt;text-indent: 0pt;line-height: 114%;text-align: justify;">A collection of algorithms that aims to identify underlying correlations within a dataset by using a computational approach that emulates the cognitive processes of the human brain.</p></td></tr></table><p style="padding-top: 3pt;padding-left: 8pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Understanding these fundamental concepts lays the groundwork for exploring the ways AI can enhance biotechnology and genetic engineering. It is through this knowledge that we can begin to appreciate the breadth and depth of opportunities available at this intersection.</p><ul id="l3"><li data-list-text="●"><p class="s31" style="padding-top: 5pt;padding-left: 29pt;text-indent: -21pt;line-height: 110%;text-align: justify;">Intersection of AI, Biotechnology, and Genetic Engineering</p></li></ul><p class="s32" style="padding-top: 6pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Emergence of the Intersection: </span><span class="p">The intersection of AI, biotechnology, and genetic engineering is a relatively  recent  development  that  gained momentum in the 21st century [21]. Technological advancements and the burgeoning availability of biological data have driven this intersection, as AI&#39;s analytical  capabilities  became  invaluable  in</span></p><p style="padding-top: 3pt;padding-left: 29pt;text-indent: 0pt;line-height: 114%;text-align: justify;">managing, processing, and interpreting this data [22].</p><p class="s32" style="padding-top: 5pt;padding-left: 29pt;text-indent: -21pt;line-height: 114%;text-align: justify;">✔  <span class="h4">AI&#39;s  Role  in  Biotechnology  and  Genetic Engineering: </span><span class="p">AI technologies, primarily machine learning, have shown significant promise in dealing with complex biological systems. Machine learning algorithms excel at finding patterns in large datasets, a feature that&#39;s particularly useful in interpreting genetic data and predicting biological outcomes [3], [23-30]. AI can contribute to both these fields in several  ways,  such  as  accelerating  the  drug discovery  process,  optimizing  bioprocesses, predicting gene functions, and designing genetic modifications [4]. Table 2 shows the comparison of the techniques.</span></p><h4 style="padding-top: 5pt;text-indent: 0pt;text-align: center;">Table 2<span class="p">. Comparison of Techniques</span></h4><p style="text-indent: 0pt;text-align: left;"><br/></p><table style="border-collapse:collapse;margin-left:31.074pt" cellspacing="0"><tr style="height:20pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 30pt;text-indent: 0pt;text-align: left;">Technique</p></td><td style="width:128pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 21pt;text-indent: 0pt;text-align: left;">Traditional Method</p></td><td style="width:217pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 70pt;text-indent: 0pt;text-align: left;">AI-Based Method</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Genome Sequencing</p></td><td style="width:128pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Sanger&#39;s method</p></td><td style="width:217pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 115%;text-align: left;">Next-generation sequencing (NGS) with ML algorithms for data interpretation</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Disease Diagnosis</p></td><td style="width:128pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Based on symptoms and medical imaging</p></td><td style="width:217pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">AI-based predictive models using patient&#39;s health data</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Drug Discovery</p></td><td style="width:128pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Trial and Error method</p></td><td style="width:217pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 115%;text-align: left;">AI algorithms predicting the interaction between drug and its target</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Crop Improvement</p></td><td style="width:128pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 39pt;text-indent: 0pt;line-height: 114%;text-align: left;">Traditional breeding techniques</p></td><td style="width:217pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Precision breeding using AI predictive models</p></td></tr><tr style="height:33pt"><td style="width:106pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Protein Folding</p></td><td style="width:128pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Experimental procedures in lab</p></td><td style="width:217pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Deep learning models like AlphaFold</p></td></tr></table><p style="padding-top: 2pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s32" style="padding-top: 5pt;padding-left: 29pt;text-indent: -21pt;line-height: 114%;text-align: justify;">✔  <span class="h4">How Biotechnology and Genetic Engineering Fuel AI: </span><span class="p">Conversely, biotechnology and genetic engineering also offer substantial opportunities for the advancement of AI [31]. Biological systems are incredibly complex and dynamic, presenting a rich source of problems that push the boundaries of current AI technologies. Tackling these problems could lead to more sophisticated AI models [32-38]. Additionally, insights from genetic algorithms, neural networks, and biological learning processes could inspire new AI techniques [5].</span></p><p class="s32" style="padding-top: 5pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Challenges  in  the  Intersection:  </span><span class="p">Despite  the potential  benefits,  the  convergence  of  AI, biotechnology, and genetic engineering also presents several challenges [39-42]. These challenges include data privacy and security concerns, ethical issues around genetic modifications, regulatory hurdles, and technical issues, like the difficulty of integrating AI with complex biological systems [6].</span></p><p class="s32" style="padding-top: 5pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Potential and Future Directions: </span><span class="p">The intersection of AI, biotechnology, and genetic engineering is a rapidly expanding field with tremendous potential [43-49]. Future directions might involve more personalized  medical treatments, efficient bio- manufacturing processes, sustainable agricultural practices, and many other applications yet to be imagined [7].</span></p></li></ul></li><li data-list-text="3."><h3 style="padding-top: 6pt;padding-left: 29pt;text-indent: -21pt;text-align: justify;">AI Techniques in Biotechnology</h3><ul id="l4"><li data-list-text="●"><h4 style="padding-top: 7pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">Machine  Learning  (ML)  in  Biotechnology: <span class="p">Machine Learning has been pivotal in processing and analyzing large-scale biological datasets [1]. Supervised learning techniques, such as SVM and RF, have been used in the categorization of gene expression and the prediction of protein structure [50-56]. Unsupervised learning methods, including as  clustering  and  dimensionality  reduction approaches, are often used in the context of data visualisation and genetic data interpretation [3].</span></h4><ul id="l5"><li data-list-text="●"><h4 style="padding-top: 3pt;padding-left: 38pt;text-indent: -21pt;line-height: 112%;text-align: justify;">Equation for the concept of Machine Learning <span class="p">Equation 1 demonstrating a basic supervised learning algorithm could be used:</span></h4><p class="s33" style="padding-top: 6pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">𝑌 = 𝑓(𝑋) + 𝜀</p><p style="padding-top: 1pt;padding-left: 52pt;text-indent: 0pt;text-align: left;">(1)</p><p style="padding-top: 7pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">Where:</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">Y represents the dependent variable or output.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;line-height: 110%;text-align: justify;">f(X) represents the systematic information that X provides about Y.</p></li><li data-list-text="●"><p style="padding-top: 6pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">X represents the independent variable or input.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">ε represents the error term.</p><h4 style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;line-height: 114%;text-align: justify;">Equation for Gradient Descent <span class="p">Equation 2 illustrates the use of the Gradient Descent method, a widely employed methodology in several ML algorithms.</span></h4><p class="s33" style="padding-top: 5pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">𝜃 = 𝜃 − 𝛼 𝛻𝐽(𝜃)</p><p style="padding-top: 1pt;padding-left: 49pt;text-indent: 0pt;text-align: center;">(2)</p><p style="padding-top: 7pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">Where:</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">θ is a parameter vector.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">α is the learning rate.</p></li><li data-list-text="●"><p class="s33" style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">∇<span class="p">J(θ) is the gradient of the loss function J at θ.</span></p></li><li data-list-text="●"><h4 style="padding-top: 3pt;padding-left: 38pt;text-indent: -21pt;line-height: 113%;text-align: justify;">Deep Learning (DL) in Biotechnology: <span class="p">DL, a subset of ML, has gained traction in biotechnology due to its superior performance in tasks with large and complex datasets [57-62]. CNNs have been successful in image-based tasks in BT, such as cell classification and microscopic image analysis [4]. RNNs, particularly LSTM networks, have been utilized in modeling biological sequences and systems [5].</span></h4><h4 style="padding-top: 6pt;padding-left: 38pt;text-indent: -21pt;line-height: 114%;text-align: justify;">Equation for the concept of Neural Networks <span class="p">Equation 3 describe how a neuron in a NN works:</span></h4><p class="s33" style="padding-top: 5pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">𝑦 = 𝑓(𝛴𝑤ᵢ𝑥ᵢ + 𝑏)</p><p style="padding-top: 1pt;padding-left: 49pt;text-indent: 0pt;text-align: center;">(3)</p><p style="padding-top: 7pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">Where:</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">y is the output.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">f is the activation function.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">wᵢ is the weight of the iᵗʰ input.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">xᵢ is the iᵗʰ input.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;text-align: left;">b is the bias.</p><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -21pt;line-height: 114%;text-align: justify;">Table  3  shows  the  different  AI  techniques  in Biotechnology</p><h4 style="padding-top: 7pt;padding-left: 9pt;text-indent: 0pt;text-align: center;">Table 3<span class="p">. AI Techniques in Biotechnology</span></h4><p style="text-indent: 0pt;text-align: left;"><br/></p><table style="border-collapse:collapse;margin-left:39.474pt" cellspacing="0"><tr style="height:20pt"><td style="width:120pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 30pt;text-indent: 0pt;text-align: left;">AI Technique</p></td><td style="width:181pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="text-indent: 0pt;text-align: center;">Description</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 3pt;padding-right: 2pt;text-indent: 0pt;text-align: center;">Example</p></td></tr><tr style="height:33pt"><td style="width:120pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Machine Learning</p></td><td style="width:181pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 114%;text-align: left;">Algorithms improve automatically through experience</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 114%;text-align: left;">Predictive modeling in drug discovery</p></td></tr><tr style="height:33pt"><td style="width:120pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Deep Learning</p></td><td style="width:181pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">ML with artificial neural networks</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 114%;text-align: left;">Image recognition in medical diagnosis</p></td></tr><tr style="height:33pt"><td style="width:120pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 42pt;text-indent: 0pt;line-height: 114%;text-align: left;">Natural Language Processing</p></td><td style="width:181pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 114%;text-align: left;">Computers interacting with human language</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 114%;text-align: left;">Extraction of meaningful data from biological literature</p></td></tr><tr style="height:33pt"><td style="width:120pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Neural Networks</p></td><td style="width:181pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 115%;text-align: left;">Series of algorithms that mimic human brain operations</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 115%;text-align: left;">Use in predicting protein structures</p></td></tr><tr style="height:33pt"><td style="width:120pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Reinforcement Learning</p></td><td style="width:181pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 114%;text-align: left;">AI method that learns best action based on reward feedback</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-right: 3pt;text-indent: 0pt;text-align: center;">Optimization of biotech processes</p></td></tr></table><p style="padding-top: 3pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="●"><h4 style="padding-top: 4pt;padding-left: 38pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Natural  Language  Processing  (NLP)  in Biotechnology: <span class="p">NLP has demonstrated considerable potential in biotechnology, especially in tasks involving biological literature mining, database curation, and gene ontology [6], [63-70]. NLP algorithms can process vast amounts of unstructured text data, allowing researchers to extract useful information and generate new hypotheses [7].</span></h4></li><li data-list-text="●"><h4 style="padding-top: 6pt;padding-left: 38pt;text-indent: -18pt;line-height: 112%;text-align: justify;">Reinforcement Learning (RL) in Biotechnology: <span class="p">RL, a subfield of ML that focuses on the decision- making process of software agents in order to</span></h4><p style="padding-top: 4pt;padding-left: 41pt;text-indent: 0pt;line-height: 114%;text-align: justify;">maximise  cumulative  reward  within  a  given environment, has potential in the optimisation of biotechnological   processes   [71-78].   The applications  of  this  technology  include  the optimisation  of  bioreactor settings  to  achieve maximum production, as well as the modelling of biological systems [8].</p><h4 style="padding-top: 5pt;padding-left: 20pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Equation for the concept of Reinforcement Learning <span class="p">A common equation in reinforcement learning is the Bellman equation, which is used to find the optimal policy is given by Equation 4:</span></h4><p class="s33" style="padding-top: 3pt;padding-left: 8pt;text-indent: 0pt;text-align: left;">𝑉ᵢ(𝑠) = 𝑚𝑎𝑥ₐ 𝑅(𝑠, 𝑎) + 𝛾 ∑ₛ′ 𝑃ₛₛ′₍ₐ₎ 𝑉ᵢ₋₁(𝑠′)</p><p style="padding-top: 1pt;padding-left: 4pt;text-indent: 0pt;text-align: center;">(4)</p><p style="padding-top: 7pt;padding-left: 8pt;text-indent: 0pt;text-align: left;">Where:</p></li></ul></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 29pt;text-indent: -18pt;text-align: left;">Vᵢ(s) is the value of state s under iteration i.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 29pt;text-indent: -18pt;text-align: left;">maxₐ is the maximum over all possible actions.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 29pt;text-indent: -18pt;line-height: 109%;text-align: left;">R(s, a) is the immediate reward on taking action a in state s.</p></li><li data-list-text="●"><p style="padding-top: 6pt;padding-left: 29pt;text-indent: -18pt;text-align: left;">γ is the discount factor.</p></li><li data-list-text="●"><p style="padding-top: 7pt;padding-left: 29pt;text-indent: -18pt;text-align: left;">Pₛₛ&#39;₍ₐ₎ is the transition probability.</p></li><li data-list-text="●"><p style="padding-top: 3pt;padding-left: 26pt;text-indent: -18pt;text-align: left;">Vᵢ₋₁(s&#39;) is the value of state s&#39; under iteration i-1.</p></li><li data-list-text="●"><h4 style="padding-top: 7pt;padding-left: 26pt;text-indent: -18pt;line-height: 113%;text-align: justify;">Graph   Neural   Networks   (GNN)   in Biotechnology:  <span class="p">Graph  Neural  Networks  are particularly useful in modeling biological structures and systems, such as protein structures, genetic networks, and metabolic pathways [79-85]. GNNs can learn complex patterns in these networks, contributing to tasks such as protein function prediction and drug discovery [9]. Figure 1 shows the AI techniques used in Biotechnology and Genetic Engineering.</span></h4><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">No. of Biotechnology Applications</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">No. of Genetic Engineering Applications</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">140</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">120</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">100</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">80</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">60</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">40</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">20</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">0</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Machine Learning</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Deep Learning</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Natural Language Processing</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Reinforcement Learning</span></p><p style="padding-left: 40pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="374" height="129" src="data:image/png;base64,"/></td></tr><tr><td><img width="374" height="128" src="data:image/png;base64,"/></td></tr></table></span></p><h4 style="padding-top: 5pt;text-indent: 0pt;text-align: center;">Fig 1<span class="p">. Distribution of AI techniques used in Biotechnology and Genetic Engineering</span></h4></li><li data-list-text="●"><p class="s31" style="padding-top: 7pt;padding-left: 29pt;text-indent: -21pt;text-align: left;">AI Techniques in Genetic Engineering</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s32" style="padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Machine Learning (ML) in Genetic Engineering: </span><span class="p">Machine Learning, particularly supervised learning techniques,  has  shown  potential  in  genetic engineering tasks [1]. Clustering and dimensionality reduction techniques, typical unsupervised learning methods, have been used to identify groups of genes with similar functions, guiding the design of genetic modifications [2].</span></p><p class="s32" style="padding-top: 6pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Deep Learning (DL) in Genetic Engineering: </span><span class="p">Deep Learning, with its ability to model complex nonlinear relationships, has become increasingly popular in genetic engineering. CNNs have been applied  to  predict  the  effects  of  genetic modifications on an organism&#39;s phenotype based on its  genotype  [3].  Recurrent  Neural  Networks (RNNs), particularly those using LSTM units, have been used to model the sequential nature of DNA,</span></p><p style="padding-top: 7pt;padding-left: 29pt;text-indent: 0pt;line-height: 114%;text-align: justify;">aiding in tasks like gene prediction and DNA sequence generation [4].</p><h4 style="padding-top: 5pt;padding-left: 8pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Equation for Genetic Algorithms <span class="p">Genetic algorithms typically use a fitness function to guide the evolution process. Here is an example of a basic fitness function:</span></h4><p class="s33" style="padding-top: 6pt;padding-left: 8pt;text-indent: 0pt;text-align: justify;">𝐹𝑖𝑡𝑛𝑒𝑠𝑠(𝐼𝑛𝑑𝑖𝑣𝑖𝑑𝑢𝑎𝑙) = 𝑓(𝐼𝑛𝑑𝑖𝑣𝑖𝑑𝑢𝑎𝑙)</p><p style="padding-top: 9pt;text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 8pt;text-indent: 0pt;line-height: 114%;text-align: justify;">Where f is a function that measures the quality of the individual in the context of the problem to be solved.</p><p class="s32" style="padding-top: 6pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Natural Language Processing (NLP) in Genetic Engineering: </span><span class="p">NLP has been utilized in genetic engineering to process large amounts of unstructured text data, such as genetic annotations and biological literature. NLP can aid in tasks like identifying gene- disease associations from literature, which is crucial for designing genetic interventions [5]. Figure 2 shows the improvement in Biotechnology and Genetic Engineering Techniques due to AI.</span></p><p style="text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">100</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">90</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">80</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">70</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">60</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">50</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">40</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">30</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">20</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">10</span></p><p style="padding-top: 3pt;text-indent: 0pt;text-align: right;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">0</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Technique 1</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Technique 2</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Technique 3</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Technique 4</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Traditional Efficiency (%)</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">AI-Improved Efficiency (%)</span></p><p style="padding-left: 48pt;text-indent: 0pt;text-align: left;"/><h4 style="padding-top: 5pt;padding-left: 9pt;text-indent: 0pt;text-align: center;">Fig 2<span class="p">. Improvement in Biotechnology and Genetic Engineering Techniques due to AI</span></h4><p class="s32" style="padding-top: 7pt;padding-left: 38pt;text-indent: -18pt;line-height: 113%;text-align: justify;">✔  <span class="h4">Reinforcement  Learning  (RL)  in  Genetic Engineering: </span><span class="p">The discipline of genetic engineering is now investigating the potential use of RL, which has the capacity to acquire proficiency in intricate decision-making tasks. The use of this approach has been seen in many tasks, such as the optimisation of genetic alterations in order to attain a certain phenotype. This particular work may be regarded as a problem of sequential decision-making [6].</span></p><p class="s32" style="padding-top: 7pt;padding-left: 38pt;text-indent: -18pt;line-height: 114%;text-align: justify;">✔  <span class="h4">Graph Neural Networks (GNN) in Genetic Engineering: </span><span class="p">Graph Neural Networks have shown potential in modeling the interactions between genes, which can often be represented as a graph or network. These networks can aid in tasks like predicting  the  effects  of  gene  knockouts  or modifications on the entire gene network [7]. Table 4 shows the AI techniques in Genetic Engineering and Figure 3 shows the applications of different AI Techniques.</span></p><h4 style="padding-top: 5pt;padding-left: 9pt;text-indent: 0pt;text-align: center;">Table 4<span class="p">. AI Techniques in Genetic Engineering</span></h4><p style="text-indent: 0pt;text-align: left;"><br/></p><table style="border-collapse:collapse;margin-left:39.474pt" cellspacing="0"><tr style="height:20pt"><td style="width:113pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 27pt;text-indent: 0pt;text-align: left;">AI Technique</p></td><td style="width:188pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="text-indent: 0pt;text-align: center;">Description</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 3pt;padding-right: 2pt;text-indent: 0pt;text-align: center;">Example</p></td></tr><tr style="height:33pt"><td style="width:113pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">RL</p></td><td style="width:188pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">AI learns to make decisions from trial and error</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Optimizing genetic algorithms</p></td></tr><tr style="height:33pt"><td style="width:113pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">DL</p></td><td style="width:188pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">ML with artificial neural networks</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 9pt;text-indent: 0pt;line-height: 115%;text-align: left;">Predicting outcomes of genetic modifications</p></td></tr><tr style="height:33pt"><td style="width:113pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">NN</p></td><td style="width:188pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Computational systems that draw indirect inspiration from biological NN.</p></td><td style="width:150pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-a