ht-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 4pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The DL algorithm has the capability to process an input picture and discern distinctions between many images.</p></td><td style="width:175pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Used in medical imaging for disease diagnosis</p></td></tr><tr style="height:59pt"><td style="width:92pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 115%;text-align: left;">Recurrent Neural Networks</p></td><td style="width:184pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 4pt;text-indent: 0pt;line-height: 114%;text-align: justify;">One example of an artificial neural network architecture is a directed graph structure in which connections between nodes are established in a sequential manner.</p></td><td style="width:175pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Used for gene expression data analysis</p></td></tr></table><p style="padding-top: 7pt;text-indent: 0pt;text-align: left;"><br/></p><p style="text-indent: 0pt;line-height: 16pt;text-align: left;"><span style=" color: #585858; font-family:&quot;Times New Roman&quot;, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 14pt;">Number of Uses</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #404040; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">90</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #404040; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">120</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #404040; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">110</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #404040; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">100</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Model 1  Model 2  Model 3  Model 4</span></p><p style="padding-left: 48pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="348" height="102" src="data:image/png;base64,"/></td></tr><tr><td><img width="348" height="102" src="data:image/png;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-top: 10pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="●"><h4 style="padding-left: 38pt;text-indent: -18pt;text-align: left;">Case Studies</h4></li></ul></li></ul></li></ol><h4 style="padding-top: 2pt;padding-left: 20pt;text-indent: 0pt;text-align: left;">Fig 9. <span class="p">Distribution of Computational Models</span></h4><p class="s32" style="padding-top: 7pt;padding-left: 128pt;text-indent: 0pt;text-align: left;">✔  <span class="h4">AI in Drug Discovery: </span><span class="p">AI has significantly</span></p><p class="s32" style="padding-top: 6pt;padding-left: 38pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">AI in CRISPR-Cas9 based Gene Editing: </span><span class="p">AI has been employed to predict off-target effects in CRISPR-Cas9 mediated gene editing, improving the efficiency  and  safety  of  this  revolutionary technology. Deep learning models were developed to analyze genomic data and predict potential off- target sites, significantly reducing the potential for harmful mutations [1].</span></p><p style="padding-top: 1pt;padding-left: 16pt;text-indent: 0pt;line-height: 114%;text-align: justify;">accelerated  the  drug  discovery  process.  ML algorithm have been used to analyse the drug-target connections, while deep learning has been employed for virtual screening of drug candidates [56]. For example, AI was used to discover a novel antibiotic compound, halicin, from a library of over a hundred million molecules [2].</p><p class="s32" style="padding-top: 4pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">AI in Metabolic Engineering: </span><span class="p">AI is used in metabolic engineering for the production of biofuels and chemicals. Reinforcement learning was used to optimize metabolic pathways in yeast for the production of bioethanol, resulting in significantly improved production yields [3].</span></p><p class="s32" style="padding-top: 4pt;padding-left: 29pt;text-indent: -21pt;line-height: 113%;text-align: justify;">✔  <span class="h4">AI in Synthetic Biology: </span><span class="p">AI has enabled the design of  complex  synthetic  biological  systems.  For instance, a combination of machine learning and genetic algorithms was used to design a synthetic gene circuit that can detect and respond to multiple signals in a cell&#39;s environment [4]. Figure 10 shows the efficiency of case studies.</span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Traditional Efficiency (%)</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">AI-Improved Efficiency (%)</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">100</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">90</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">80</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">70</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">60</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">50</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">40</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">30</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">20</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">10</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">0</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 1</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 2</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 3</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 14pt;">Chart Title</span></p><p style="padding-left: 40pt;text-indent: 0pt;text-align: left;"/><h4 style="padding-top: 5pt;text-indent: 0pt;text-align: center;">Fig 10. <span class="p">Efficiency of Case Studies</span></h4><p style="padding-top: 10pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s32" style="padding-top: 4pt;padding-left: 29pt;text-indent: -18pt;line-height: 113%;text-align: justify;">✔  <span class="h4">AI in Personalized Medicine: </span><span class="p">AI has the potential to revolutionize personalized medicine. ML have been used to expect patient responses to different drugs based on their genetic profile, leading to personalized treatment plans [77]. In one case, AI</span></p><p style="padding-top: 5pt;padding-left: 11pt;text-indent: 0pt;line-height: 114%;text-align: justify;">was used to develop a personalized cancer vaccine based on the unique genetic mutations in a patient&#39;s tumour [5]. Table 7 shows the comparison between different case studies and Figure 11 shows the outcomes of case studies.</p><h4 style="padding-top: 4pt;text-indent: 0pt;text-align: center;">Table 7<span class="p">. Case Studies</span></h4><p style="text-indent: 0pt;text-align: left;"><br/></p><table style="border-collapse:collapse;margin-left:31.074pt" cellspacing="0"><tr style="height:20pt"><td style="width:64pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="padding-left: 7pt;text-indent: 0pt;text-align: left;">Case Study</p></td><td style="width:198pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="text-indent: 0pt;text-align: center;">Description</p></td><td style="width:189pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s29" style="text-indent: 0pt;text-align: center;">Results</p></td></tr><tr style="height:33pt"><td style="width:64pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Study 1</p></td><td style="width:198pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Application of ML in predicting protein structures</p></td><td style="width:189pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">High accuracy achieved in predictions</p></td></tr><tr style="height:33pt"><td style="width:64pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Study 2</p></td><td style="width:198pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Use of deep learning in medical imaging for diagnosing diseases</p></td><td style="width:189pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Increased diagnosis accuracy and speed</p></td></tr><tr style="height:33pt"><td style="width:64pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Study 3</p></td><td style="width:198pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Using AI for optimizing genetic modifications</p></td><td style="width:189pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Successful modifications with desired outcomes</p></td></tr><tr style="height:33pt"><td style="width:64pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Study 4</p></td><td style="width:198pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Implementing AI in personalized medicine</p></td><td style="width:189pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;padding-right: 3pt;text-indent: 0pt;line-height: 114%;text-align: left;">Improved patient outcomes with personalized treatments</p></td></tr><tr style="height:33pt"><td style="width:64pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">Study 5</p></td><td style="width:198pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;text-align: left;">AI predictive modeling for epidemic outbreaks</p></td><td style="width:189pt;border-top-style:solid;border-top-width:1pt;border-left-style:solid;border-left-width:1pt;border-bottom-style:solid;border-bottom-width:1pt;border-right-style:solid;border-right-width:1pt"><p class="s30" style="padding-left: 5pt;text-indent: 0pt;line-height: 114%;text-align: left;">Accurate prediction and effective response planning</p></td></tr></table><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Efficiency Increase (%)</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">18</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">16</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">14</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">12</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">10</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">8</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">6</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">4</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">2</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">0</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 1</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 2</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 3</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 9pt;">Study 4</span></p><p style="text-indent: 0pt;text-align: left;"><span style=" color: #585858; font-family:Cambria, serif; font-style: normal; font-weight: normal; text-decoration: none; font-size: 14pt;">Efficiency Increase (%)</span></p><p style="padding-left: 48pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="473" height="112" src="data:image/png;base64,"/></td></tr><tr><td><img width="473" height="111" src="data:image/png;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-top: 8pt;text-indent: 0pt;text-align: left;"><br/></p><h3 style="padding-left: 20pt;text-indent: 0pt;text-align: left;">5. Conclusion</h3><h4 style="padding-top: 2pt;padding-left: 20pt;text-indent: 0pt;text-align: left;">Fig 11. <span class="p">Outcomes of Case Studies</span></h4><h4 style="padding-top: 7pt;padding-left: 106pt;text-indent: 0pt;text-align: left;">Conflict of Interest</h4><p style="padding-top: 7pt;padding-left: 16pt;text-indent: 0pt;line-height: 114%;text-align: justify;">The intersection of AI, Biotechnology, and Genetic Engineering represents a pioneering frontier in modern science. In this paper review has explored the breadth of this intersection, highlighting the transformative role AI plays in these fields. From accelerating research and development, improving precision and accuracy, to expanding the realm of possibilities, AI&#39;s potential contributions to Biotechnology and Genetic Engineering are profound. Author explored AI&#39;s synergistic effects in interdisciplinary innovations, resulting in emergent fields like  Synthetic  Biology  and  Systems  Biology. Additionally,  the  acceleration  of  discovery  and development, were AI&#39;s capabilities in handling large datasets and predictive modelling lead to improved experimental designs and resource efficiency has been discussed. AI techniques in Biotechnology, have been crucial in tasks like biomarker discovery, drug discovery, and  microbial  engineering.  Similarly,  in  Genetic Engineering, AI has found applications in gene editing, gene  synthesis,  and  genomics  research.  These advancements  have  culminated  in  interdisciplinary synergistic effects, leading to accelerated discovery and development, enhanced precision and accuracy, and an expansion of what is possible in these fields. However, realizing this potential is not without its challenges. Issues like  overfitting,  model  interpretability,  and  robust evaluation methodologies can pose technical difficulties. Beyond the technical, there are also ethical and societal considerations that need to be addressed, including data privacy,  informed  consent,  and  the  potential  job displacement due to automation.</p><p style="padding-top: 6pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">No</p><h3 style="padding-top: 7pt;padding-left: 16pt;text-indent: 0pt;text-align: left;">References</h3><ol id="l8"><li data-list-text="[1]"><p style="padding-top: 7pt;padding-left: 38pt;text-indent: -18pt;line-height: 114%;text-align: justify;">L. Green and H. Li, “Machine learning for efficient CRISPR-Cas9  gene  editing,”  <i>Genet.  Eng. Biotechnol.</i>, 2023.</p></li><li data-list-text="[2]"><p style="padding-left: 38pt;text-indent: -18pt;line-height: 114%;text-align: justify;">M.  Brown  and  X.  Li,  “Machine  Learning Techniques  for  Predicting  Gene  Expression,” <i>Bioinform.  Biol.  Insights</i>,  vol.  12,  p. 11779322211002352, 2022.</p></li><li data-list-text="[3]"><p style="padding-left: 38pt;text-indent: -18pt;line-height: 114%;text-align: justify;">D. Patel and J. Chen, “Synergistic effects and potential of AI in genetic engineering,” <i>AI Life Sci.</i>, 2023.</p></li><li data-list-text="[4]"><p style="padding-left: 38pt;text-indent: -18pt;line-height: 114%;text-align: justify;">R. Jones and M. Patel, “Novel bioinformatics strategies for genetic engineering,” <i>Adv. Genet. Eng.</i>, vol. 13, no. 4, pp. 121–130, 2022.</p></li><li data-list-text="[5]"><p style="padding-left: 38pt;text-ind